import React, { Component } from "react";
import { Link } from "react-router-dom";
class Clientitem extends Component {
  render() {
    const { client } = this.props;
    return (
      <div className="x_content">
        <tbody>
          <tr className="even pointer">
            <td className="a-center "></td>
            <td>{client.codeClient}</td>
            <td>{client.firstName} </td>
            <td>
              {client.lastName} <i className="success fa fa-long-arrow-up" />
            </td>
            <td className=" ">{client.adresse}</td>
            <td className=" ">{client.year}</td>
            <td className="a-right a-right ">{client.email}</td>

            <td>{client.phone} </td>
          </tr>
        </tbody>
      </div>
    );
  }
}

export default Clientitem;
